:root {
  /* STABLE COLOR PALETTE */
  --brand-primary: var(--sapButton_Emphasized_Background);
  --brand-primary-highlight: var(--sapButton_Emphasized_Hover_Background);
  --brand-secondary: var(--sapInformationColor);
  --brand-secondary-highlight: var(--sapButton_Information_Hover_Background);
  --text-color: var(--sapTextColor);
  --link-color: var(--sapLinkColor);
  --link-hover-color: var(--sapLink_Hover_Color);
  --global-hover-bg: var(--sapList_Hover_Background);
  --global-active-bg: var(--sapList_Hover_Background);
  --state-success-text: var(--sapSuccessColor);
  --state-success-bg: var(--sapSuccessBackground);
  --state-success-border: var(--sapSuccessBorderColor);
  --state-warning-text: var(--sapCriticalTextColor);
  --state-warning-bg: var(--sapWarningBackground);
  --state-warning-border: var(--sapWarningBorderColor);
  --state-danger-text: var(--sapErrorColor);
  --state-danger-bg: var(--sapErrorBackground);
  --state-danger-border: var(--sapErrorBorderColor);
  --state-info-text: var(--brand-secondary);
  --state-info-bg: var(--sapInformationBackground);
  --state-info-border: var(--sapInformationBorderColor);
  --black: #000;
  --gray-darkest: #354a5f;
  --gray-darker: var(--sapTitleColor);
  --gray-dark: var(--sapNeutralTextColor);
  --gray: var(--sapNeutralBorderColor);
  --gray-light: var(--sapContent_NonInteractiveIconColor);
  --gray-lighter: var(--sapList_BorderColor);
  --gray-lightest: var(--sapNeutralBackground);
  --white: var(--sapBaseColor);
  --accent-color-1: var(--sapAccentColor1);
  --accent-color-2: var(--sapAccentColor2);
  --accent-color-3: var(--sapAccentColor3);
  --accent-color-4: var(--sapAccentColor4);
  --accent-color-5: var(--sapAccentColor5);
  --accent-color-6: var(--sapAccentColor6);
  --accent-color-7: var(--sapAccentColor7);
  --accent-color-8: var(--sapAccentColor8);
  --accent-color-9: var(--sapAccentColor9);
  --accent-color-10: var(--sapAccentColor10);
  /* ------------------------------------------------
     ATTENTION: DO NOT USE VARIABLES BELOW THIS LINE IN YOUR APPLICATION.
    VALUES CAN CHANGE AT ANY TIME AND WILL NOT BE REFLECTED IN VERISONING.
    --------------------------------------------------
    */
  --cnqrRootElementFontSize: 16px;
  --cnqrLegend_BorderColor: var(--sapField_BorderColor);
  --cnqrColors_GreyLighter: var(--gray-lighter);
  --cnqrColors_GrayDarkest: var(--gray-darkest);
  --cnqrColors_Legacy_GreyLighter: var(--sapContent_Illustrative_Color7);
  --cnqrColors_Body_BackgroundColor: var(--sapBackgroundColor);
  --cnqrColors_LegacyBorder: var(--sapGroup_ContentBorderColor);
  --cnqrColors_LegacyVeryLight: var(--sapShell_Background);
  --cnqrColors_Black: var(--black);
  --cnqrText_Overflow_WhiteSpace: nowrap;
  --cnqrText_Overflow_Position: relative;
